Diede and Dylan are GOLDEN SLAMMERS! 🏆 🎾 

@diededegroot seals the Golden Slam and is women’s champion.🏆 🏆 🏆 🥇 🏆 

@dylanalcott seals the Golden Slam in the Quads competition. 🏆 🏆 🏆 🥇 🏆 

@shingokunieda wins his 25th Grand Slam title, and eighth US Open title in the men’s comp. 🏆 

Photos: @gettyimages 
Videos: @usopen 

